import './App.css';
import GreetAll from './components/GreetAll'
import WelcomeAll from './components/WelcomeAll';

function App() {
  return (
    <div className="App">
     <GreetAll name ="Kanmani">
      <h4>Have a good day</h4>
     </GreetAll>
     <GreetAll name="Venkat"/>
     <WelcomeAll/>
    </div>
  );
}

export default App;
